package com.java.spring.camel.api;

import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;@Entitypublic class alumnos {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private int id_alumno;    private String nombre;    private String a_paterno;	private String a_materno;    public alumnos() {  }    public alumnos(String nombre, String a_paterno, String a_materno, int edad,String carrera, int semestre,String tutor, int promedio, int porcentaje_carrera, 	int credito_aprobados, int materias_reprobadas) {        this.setnombre(nombre);        this.seta_paterno(a_paterno);		this.seta_materno(a_materno);		this.seta_edad(a_edad);		this.seta_carrera(a_carrera);		this.seta_semestre(a_semestre);		this.seta_tutor(a_tutor);		this.seta_promedio(a_promedio);		this.seta_porcentaje_carrera(a_porcentaje_carrera);		this.seta_credito_aprobados(a_credito_aprobados);		this.seta_materias_reprobadas(a_materias_reprobadas);		}    public alumnos(int id, String nombre, String a_paterno,String a_materno,int edad, String carrera, int semestre, String tutor, int promedio, int porcentaje_carrera, 	int credito_aprobados, int materias_reprobadas) {        this.setId(id);        this.setnombre(nombre);        this.seta_paterno(a_paterno);		this.seta_materno(a_materno);		this.seta_edad(a_edad);		this.seta_carrera(a_carrera);		this.seta_semestre(a_semestre);		this.seta_tutor(a_tutor);		this.seta_promedio(a_promedio);		this.seta_porcentaje_carrera(a_porcentaje_carrera);		this.seta_credito_aprobados(a_credito_aprobados);		this.seta_materias_reprobadas(a_materias_reprobadas);    }    public int getId() {   return id;     }    public void setId(int id) {   this.id = id;     }    public String getnombre() {   return nombre;     }	public void setnombre(String nombre) {  this.nombre = nombre;     }    public String geta_paterno() {  return a_paterno;     }    public void seta_paterno(String a_paterno) {  this.a_paterno = a_paterno;     }		public String geta_materno() {  return a_materno;     }    public void seta_materno(String a_materno) {  this.a_materno = a_materno;     }		public int geta_edad() {  return a_edad;     }    public void seta_edad(int a_edad) {  this.a_edad = a_edad;     }		public String geta_carrera() {  return a_carrera;     }    public void seta_carrera(String a_carrera) {  this.a_carrera = a_carrera;     }		public int geta_semestre() {  return a_semestre;     }    public void seta_semestre(int a_semestre) {  this.a_semestre = a_semestre;     }	public String geta_tutor() {  return a_tutor;     }    public void seta_tutor(String a_tutor) {  this.a_tutor = a_tutor;     }		public String geta_promedio() {  return a_promedio;     }    public void seta_promedio(String a_promedio) {  this.a_promedio = a_promedio;     }		public int geta_porcentaje_carrera() {  return a_porcentaje_carrera;     }    public void seta_porcentaje_carrera(int a_porcentaje_carrera) {  this.a_porcentaje_carrera = a_porcentaje_carrera;     }		public int geta_credito_aprobados() {  return a_credito_aprobados;     }    public void seta_credito_aprobados(int a_credito_aprobados) {  this.a_credito_aprobados = a_credito_aprobados;     }		public int geta_materias_reprobadas() {  return a_materias_reprobadas;     }    public void seta_materias_reprobadas(int a_materias_reprobadas) {  this.a_materias_reprobadas = a_materias_reprobadas;     }	    @Override    public String toString() {        return "Alumnos{" +                "id=" + id +                ", nombre='" + nombre + '\'' +                ", a_paterno='" + a_paterno + '\'' +				", a_materno='" + a_materno + '\'' +				", a_edad='" + a_edad + '\'' +				", a_carrera='" + a_carrera + '\'' +				", a_semestre='" + a_semestre + '\'' +				", a_tutor='" + a_tutor + '\'' +				", a_promedio='" + a_promedio + '\'' +				", a_porcentaje_carrera='" + a_porcentaje_carrera + '\'' +				", a_credito_aprobados='" + a_credito_aprobados + '\'' +				", a_materias_reprobadaso='" + a_materias_reprobadas + '\'' +                '}';    }
	
}